<!DOCTYPE html>
<html>
<head>
<meta charset='utf-8'>
<style TYPE='text/css'>
body {
	background-color: #252525;
	color: #e8e8e8
}

.highlighter .add { 
	background-color: #1c7b50;
}

.highlighter .remove { 
	background-color: #80372b;
}

.highlighter td.modify { 
	background-color: #2c5075;
}

.highlighter td.conflict { 
	background-color: #c72c41;
}

.highlighter .spec { 
	background-color: #505050;
}

.highlighter .move { 
	background-color: #353535;
}

.highlighter .null { 
	color: #666;
}

.highlighter table { 
	border-collapse:collapse;
}

.highlighter td, .highlighter th {
	border: 1px solid #444;
	padding: 3px 7px 2px;
}

.highlighter th, .highlighter .header, .highlighter .meta {
	background-color: #636363;
	font-weight: bold;
	padding-bottom: 4px;
	padding-top: 5px;
	text-align:left;
}

.highlighter tr.header th {
	border-bottom: 2px solid black;
}

.highlighter tr.index td, .highlighter .index, .highlighter tr.header th.index {
	background-color: #4a4a4a;
	border: none;
}

.highlighter .gap {
	color: #666;
}

.highlighter td {
	empty-cells: show;
	white-space: pre-wrap;
}
</style>
</head>
<body>
<div class='highlighter'>
<table>
<thead>
<tr class="header"><th>@@</th><th>﻿key: int32</th><th>0: str</th><th>1: str</th><th>2: str</th></tr>
</thead>
<tbody>
<tr class="gap"><td>...</td><td>...</td><td>...</td><td>...</td><td>...</td></tr>
<tr><td></td><td>98</td><td>Frontline Score Info</td><td>FrontlineScore</td><td>flscore</td></tr>
<tr class="modify"><td class="modify">→</td><td>99</td><td class="modify">→Blunderville Objective</td><td class="modify">→BlunderObjective</td><td class="modify">→bvgoal</td></tr>
<tr class="modify"><td class="modify">→</td><td>100</td><td class="modify">→Blunderville Score</td><td class="modify">→BlunderScore</td><td class="modify">→bvscore</td></tr>
<tr class="modify"><td class="modify">→</td><td>101</td><td class="modify">→Blunderville Status</td><td class="modify">→BlunderStatus</td><td class="modify">→bvstatus</td></tr>
<tr class="modify"><td class="modify">→</td><td>102</td><td class="modify">→Blunderville Show Log</td><td class="modify">→BlunderShowLog</td><td class="modify">→bvlog</td></tr>
</tbody>
</table>
</div>
</body>
</html>
